	(4474,'2013-06-22 12:00:00',60,5,'Tom Sangwin',2,'POD','SECURITYNO','0000000000','mail@mail.com','60 minute bespoke flight Bamburgh','Simon Smith',' Marilyn was born in Bamburgh and lived there for two years before moving to Alnwick where her Father was a Fireman. She remained there in the same house on the Fire Station until we married in 1982, when with me being in the Royal Air Force stationed at RAF Boulmer, the RAF promptly posted us to RAF Benbecular in the Outer Hebrides (who says the RAF has no sense of humour).\r\n \r\nI plan to have a few people strategically placed in a couple of spots just to give her a wave if that is possible. The first would be over the new earth work called \'slag Alice\' or Northumberlandia to give her the real name near to you in Cramlington, I hope to have her nephew there. The second place I hope you could go is Alnwick Fire Station so she can see her old home, her Mother stayed in the house there until her death three years ago; again I hope to have the next door neighbours come out to give her a wave. The third and final person to do the waving thing would be a very dear friend who will park his white and orange (cannot miss it) VW camper van on Boulmer Steel.\r\n \r\nThey are the three main things I would like plus Bamburgh Castle of course.',1,0,'','','0000-00-00 00:00:00'),
	(4475,'2013-06-22 12:00:00',60,5,'Tom Sangwin',2,'POD','SECURITYNO','0000000000','mail@mail.com','60 minute bespoke flight Bamburgh','Simon Smith',' Marilyn was born in Bamburgh and lived there for two years before moving to Alnwick where her Father was a Fireman. She remained there in the same house on the Fire Station until we married in 1982, when with me being in the Royal Air Force stationed at RAF Boulmer, the RAF promptly posted us to RAF Benbecular in the Outer Hebrides (who says the RAF has no sense of humour).\r\n \r\nI plan to have a few people strategically placed in a couple of spots just to give her a wave if that is possible. The first would be over the new earth work called \'slag Alice\' or Northumberlandia to give her the real name near to you in Cramlington, I hope to have her nephew there. The second place I hope you could go is Alnwick Fire Station so she can see her old home, her Mother stayed in the house there until her death three years ago; again I hope to have the next door neighbours come out to give her a wave. The third and final person to do the waving thing would be a very dear friend who will park his white and orange (cannot miss it) VW camper van on Boulmer Steel.\r\n \r\nThey are the three main things I would like plus Bamburgh Castle of course.',1,0,'','','0000-00-00 00:00:00'),
